function ClickB_Item(CBI) {
	SRV = 1 * c.server.value;

	if (CBI == "SW") {
		if (n_itemSW)
			n_itemSW = 0;
		else
			n_itemSW = 1;
	}
	if (n_itemSW == 1 && CBI == "SW" && Item_or_Card == "Card") {
		Card(ItemCardNumberCheck);
		return;
	}
	if (CBI != "SW") {
		Item_or_Card = "Item";
		ItemCardNumberCheck = CBI;
	}
	ActiveSkillSetPlus();

	if (CBI == "SW") {
		if (n_itemSW == 0) {
			myInnerHtml("ITEM_TITLE", "Item Data", 0);
			for (i = 1; i <= 4; i++)
				myInnerHtml("ITEM" + i, "", 0);
			myInnerHtml("ITEM_W_LV", "", 0);
			myInnerHtml("ITEM_DATA", "", 0);
			myInnerHtml("ITEM_LV", "", 0);
			myInnerHtml("ITEM_WAIT", "", 0);
			myInnerHtml("B_SETUMEI", "", 0);
			return;
		} else {
			CBI = ItemCardNumberCheck;
		}
	}
	if (n_itemSW == 0)
		return;
	myInnerHtml("ITEM_TITLE", m_Item[CBI][8] + " [" + m_Item[CBI][5] + "]", 0);
	myInnerHtml("ITEM3", "Req. Lvl:", 0);
	myInnerHtml("ITEM4", "Weight:", 0);
	if (m_Item[CBI][1] < 50) {
		myInnerHtml("ITEM1", "ATK:", 0);
		myInnerHtml("ITEM2", "Weapon Lvl:", 0);
		myInnerHtml("ITEM_W_LV", m_Item[CBI][4], 0);
	}
	else {
		myInnerHtml("ITEM1", "DEF:", 0);
		myInnerHtml("ITEM2", "-", 0);
		myInnerHtml("ITEM_W_LV", "-", 0);
	}
	myInnerHtml("ITEM_DATA", m_Item[CBI][3], 0);
	myInnerHtml("ITEM_LV", m_Item[CBI][7], 0);
	myInnerHtml("ITEM_WAIT", m_Item[CBI][6], 0);

	CBIstr = "";
	for (i = 11; m_Item[CBI][i] > 0; i += 2)
		Item_Setumei(m_Item[CBI][i], m_Item[CBI][i + 1]);
	if (m_Item[CBI][10] != 0)
		CBIstr += m_Item[CBI][10] + "<BR>";

	var check = 0;
	for (var i = 11; m_Item[CBI][i] != 0; i += 2) {
		if (m_Item[CBI][i] == 90) {
			CBIstr += "<HR><B>When equipping " + SetEquipName(m_Item[CBI][i + 1]);
			var w = w_SE[m_Item[CBI][i + 1]][0];
			while (m_Item[CBI][i + 2] != 0 && check == 0) {
				if (w == w_SE[m_Item[CBI][i + 3]][0]) {
					CBIstr += " or<BR>" + SetEquipName(m_Item[CBI][i + 3]);
					i += 2;
				} else {
					check = 1;
				}
			}
			CBIstr += " at the same time:</B><BR>";
			check = 0;
			for (var j = 11; m_Item[w][j] != 0; j += 2)
				Item_Setumei(m_Item[w][j], m_Item[w][j + 1]);
			if (m_Item[w][10] != 0)
				CBIstr += m_Item[w][10] + "<BR>";
			CBIstr += "";
		}
	}
	myInnerHtml("B_SETUMEI", CBIstr, 0);
}

